// pages/HomePage/Home.js
import React from "react";
import Navbar from "../../components/HomePage/Navbar";
import Services from "./Services";
import WhyChooseUs from "./WhyChooseUs";
import Testimonials from "./Testimonials";
import CallToAction from "./CallToAction";
import Footer from "./Footer";
import "../../styles/HomePage/Home.css";

const Home = () => {
  return (
    <div className="home-page">
      <Navbar />
      <header className="hero-section">
        <div className="hero-content">
          <h1>Accessible, Affordable, and Reliable Healthcare</h1>
          <p>Your trusted partner for consultations, medicine orders, lab tests and more.</p>
          <div className="hero-buttons">
            <button className="btn primary-btn">Get Started</button>
            <button className="btn secondary-btn">Learn More</button>
          </div>
        </div>
        <div className="hero-image">
          <img src="/assets/HomePage/hero-bg.jpg" alt="Healthcare" />
        </div>
      </header>
      <Services />
      <WhyChooseUs />
      <Testimonials />
      <CallToAction />
      <Footer />
    </div>
  );
};

export default Home;
